import React from "react";
className =
  "cursor-pointer flex flex-col items-center bg-white rounded-lg overflow-hidden shadow-lg w-[15rem] mx-3";
const HomeSectionCard = ({product}) => {
  return (
    <div>
      <div className="h-[13rem] w-[10rem]">
        <img
          src={product}
          alt=""
          className="object-cover object-top w-full h-full"
        />
      </div>
      <div className="p-4 ">
        <h3 className="text-lg font-medium text-gray-900">Main</h3>
        <p className="mt-2 text-sm text-gray-500">This is the description</p>
      </div>
    </div>
  );
};

export default HomeSectionCard;
